const Header = (props) => {
  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}

const Part = (props) => {
  return (
    <>
      <p>{props.part} {props.exercises}</p>
    </>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part part={props.part} exercises={props.exercises} />
      <Part part={props.part} exercises={props.exercises} />
      <Part part={props.part} exercises={props.exercises} />
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>{props.text} {props.exercisesSum}</p>
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Content part={part1} exercises={exercises1} />
      <Total text={'Number of exercises'} exercisesSum={exercises1 + exercises2 + exercises3} />
    </div>
  )
}

export default App
